def check(s):
    x=0
    for char in s:
	    x = x + int(ord(char))
    return str(2**x)

def compare(s1,s2):
    return s1 == s2

s = ""

with open("sqrt-i\\29-01-2021\wordListFiltered.txt",'r') as arq:
    for i in arq:
        if(compare(check(i[:-1]),s)):
            print("ictf{"+i[:-1]+"}")
